import styled from "styled-components/macro";

export const Contanier = styled.div`
  margin: 20px;
  text-align: center;
  height: 100%;
`;

// export const TextContainer = styled.h2`
//   text-align: center;
// `;

export const Text = styled.p`
  color: white;
`;

export const Box = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  margin: 180px;
  text-align: center;
`;
